import React, {useEffect, useState} from 'react';
import axios from "axios";

interface userType {
    id: number,
    login: string,
    avatar_url: string
}

const Convert = () => {
    const [currencies, setUsers] = useState<userType[]>([])
    useEffect(() => {
        axios.get("https://open.er-api.com/v6/latest/USD").then((response) => {
            setUsers(response.data);
        }).catch((error) => {
            alert(error);
        });
    });
    return <div>
        <h2>Currencies</h2>
    </div>
}

export default Convert;
